  console.log('Redis client connected to the server');
});
function publishMessage(message, time) {
  setTimeout(function () {
    console.log("About to send ".concat(message));
    client.publish('holberton school channel', message, function (err) {
      if (err) {
        console.error('Failed to publish message:', err);
      }
    });
  }, time);
}

// Publish messages
publishMessage('Holberton Student #1 starts course', 100);
publishMessage('Holberton Student #2 starts course', 200);
publishMessage('KILL_SERVER', 300);
publishMessage('Holberton Student #3 starts course', 400);

// Close client after all messages are sent
setTimeout(function () {
  client.quit();
}, 500); // Ensure this timeout is longer than the last publish timeout
